    themeSelector(state).palette.primary.main;
export const bgColorSelector = state => _coreSliceSelector(state).bgColor;

export const forgotPasswordLoadingSelector = state =>
    _coreSliceSelector(state).forgotPasswordLoading;
export const resetPasswordLoadingSelector = state =>
    _coreSliceSelector(state).resetPasswordLoading;
export const dictionarySelector = state => _coreSliceSelector(state).dictionary;
export const isAuthSelector = state => _coreSliceSelector(state).isAuth;

export const roleSelector = state => {
    return _coreSliceSelector(state).role;
};
